import React, { useState } from "react";
import axios from "axios";

const AddTeam = () => {
  const [formData, setFormData] = useState({
    team: "",
    gamesPlayed: 0,
    win: 0,
    draw: 0,
    loss: 0,
    goalsFor: 0,
    goalsAgainst: 0,
    points: 0,
    year: 0,
  });

  const [message, setMessage] = useState(""); // For success/error messages

  // Handle input change
  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  // Handle form submission
  const handleSubmit = async (e) => {
    e.preventDefault();
    // Validate required fields
    if (!formData.team || !formData.year) {
      setMessage("Please fill in all required fields!");
      return;
    }

    try {
      const dataToSend = {
        team_name: formData.team,
        games_played: formData.gamesPlayed,
        games_won: formData.win,
        games_drawn: formData.draw,
        games_lost: formData.loss,
        goals_scored: formData.goalsFor,
        goals_conceded: formData.goalsAgainst,
        points: formData.points,
        year: formData.year,
      };

      const response = await axios.post("http://localhost:5000/api/add", dataToSend);
      setMessage(response.data.message || "Data added successfully!");
      setFormData({
        team: "",
        gamesPlayed: 0,
        win: 0,
        draw: 0,
        loss: 0,
        goalsFor: 0,
        goalsAgainst: 0,
        points: 0,
        year: 0,
      });
    } catch (error) {
      setMessage("Error adding data: " + (error.response?.data?.message || error.message));
      console.error(error);
    }
  };

  return (
    <div style={{ maxWidth: "500px", margin: "auto" }}>
      <h2>Add Team Data</h2>
      {message && <p>{message}</p>} {/* Success/Error message */}
      <form onSubmit={handleSubmit}>
        <div>
          <label>Team Name:</label>
          <input
            name="team"
            value={formData.team}
            onChange={handleChange}
            placeholder="Team"
            required
          />
        </div>
        <div>
          <label>Games Played:</label>
          <input
            name="gamesPlayed"
            type="number"
            value={formData.gamesPlayed}
            onChange={handleChange}
            placeholder="Games Played"
          />
        </div>
        <div>
          <label>Wins:</label>
          <input
            name="win"
            type="number"
            value={formData.win}
            onChange={handleChange}
            placeholder="Wins"
          />
        </div>
        <div>
          <label>Draws:</label>
          <input
            name="draw"
            type="number"
            value={formData.draw}
            onChange={handleChange}
            placeholder="Draws"
          />
        </div>
        <div>
          <label>Losses:</label>
          <input
            name="loss"
            type="number"
            value={formData.loss}
            onChange={handleChange}
            placeholder="Losses"
          />
        </div>
        <div>
          <label>Goals For:</label>
          <input
            name="goalsFor"
            type="number"
            value={formData.goalsFor}
            onChange={handleChange}
            placeholder="Goals For"
          />
        </div>
        <div>
          <label>Goals Against:</label>
          <input
            name="goalsAgainst"
            type="number"
            value={formData.goalsAgainst}
            onChange={handleChange}
            placeholder="Goals Against"
          />
        </div>
        <div>
          <label>Points:</label>
          <input
            name="points"
            type="number"
            value={formData.points}
            onChange={handleChange}
            placeholder="Points"
          />
        </div>
        <div>
          <label>Year:</label>
          <input
            name="year"
            type="number"
            value={formData.year}
            onChange={handleChange}
            placeholder="Year"
            required
          />
        </div>
        <button type="submit">Add Data</button>
      </form>
    </div>
  );
};

export default AddTeam;
